(1, 'GUmWtFeSI8OIyhIPrMgUzAhX6fyYVKAQIzk1ssaT.jpg', 'Grebeg Sura dan Misteri Harimau Jawa di Gunung Slamet', '<p style=\"text-align: justify; \">Keberadaan sebuah gunung api memengaruhi kosmologi masyarakat di sekitarnya. Mitos, legenda hingga dongeng selalu melingkupi masyarakat yang mengambil berkah di kaki-kakinya. Itu termasuk Gunung Slamet, Jawa Tengah.</p><p style=\"text-align: justify; \">Gunung Ini adalah gunung berapi terbesar di tanah Jawa. Kaki Gunung Slamet menjangkau lima kabupaten di sisi utara Jawa, sekaligus sisi selatan. Lima Kabupaten tersebut yakni, Brebes, Tegal, Pemalang, Purbalingga dan Banyumas.</p><p style=\"text-align: justify; \">Mitos yang paling terkenal adalah bahwa letusan Gunung Slamet akan membelah pulau Jawa. Nampaknya mitos itu dipengaruhi letak Gunung Slamet yang nyaris berada di tengah Pulau Jawa. Kaki-kakinya juga menjangkau sisi utara dan sisi selatan sekaligus.</p><p style=\"text-align: justify; \">Mitos terbelahnya pulau Jawa itu lambat laun luruh seiring kemajuan zaman. Tetapi, Gunung Slamet tetap Gunung Slamet. Banyak sisi misterius yang tetap tak terpecahkan hingga saat ini, meski puluhan ribu pendaki sudah menjejakkan kakinya di puncaknya setinggi 3.428 Mdpl ini.</p><p style=\"text-align: justify; \">Ari Aji, seorang aktivias BUMDes yang juga pemerhati wisata desa mengatakan, gunung ini memang populer di kalangan pendaki, meski ada pula mitos bahwa Gunung Slamet gemar menelan pendaki. Hanya di sisi selatan saja, setidaknya ada tiga jalur pendakian, meliputi Bambangan dan Gunung Tengah, Purbalingga, dan yang terbaru, jalur Baturraden.</p><p style=\"text-align: justify; \">Di antara pendaki yang berhasil mencapai puncak, memang ada yang tertimpa kemalangan. Korban meninggal dunia di Gunung Slamet umumnya adalah karena serangan hipotermia. Bisa jadi karena tubuhnya tak fit sehingga tak cukup resisten menahan cekaman suhu dingin.</p><p style=\"text-align: justify; \">Bahaya lainnya adalah tersesat di Gunung Slamet. Gunung ini memang memiliki belantara yang tak tertembus. Beragam vegetasi raksasa, hingga semak padat, menjadi benteng utama rimba Gunung Slamet.</p><p style=\"text-align: justify; \">Boleh jadi, ini lah yang melindungi Gunung Slamet dari kerusakan akibat perbuatan manusia. Hutan lereng Gunung Slamet adalah hutan lindung terluas di Pulau Jawa. Sebagiannya masih perawan alias tak terjamah.</p><p style=\"text-align: justify; \"><br></p><h4 style=\"text-align: justify; \">Jejak Harimau Jawa</h4><p style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"kemunculan-harimau-jawa-di-mata-orang-jatim-jateng-dan-sunda-cwz.jpg\" style=\"width: 50%;\"><br></p><p style=\"text-align: center;\"></p><p style=\"text-align: justify;\">Kekayaan flora dan fauna di wilayah Gunung Slamet juga luar biasa. Bahkan, pada awal Millenium, sempat mencuat isu masih adanya spesies Harimau Jawa yang telah dinyatakan punah.</p><p style=\"text-align: justify;\">Sekelompok peneliti muda mengaku menemukan bukti bukti adanya spesies ini seperti adanya feses, jejak kaki, hingga bekas cakaran di pohon di lereng Gunung Slamet. Hal ini sempat menumbuhkan dorongan dari berbagai kalangan untuk menjadikan wilayah ini sebagai Taman Nasional.</p><p style=\"text-align: justify;\">Namun hingga kini, keberadaan harimau Jawa secara fisik belum terbuktikan. Spesies kucing besar yang acap kali terlihat hanyalah macan Kumbang dan macan Tutul. Ini adalah keniscayaan mengingat di wilayah ini masih banyak terdapat babi hutan dan rusa yang merupakan makanan dari raja-raja hutan tersebut.</p><p style=\"text-align: justify;\">Terlepas dari benar dan tidaknya mitos soal Harimau Jawa tersebut, fakta bahwa Gunung Slamet adalah ekosistem hutan lindung yang luar biasa tak bisa dibantah. Karenanya, secara turun temurun, masyarakat pun secara arif berupaya menjaga dan melestarikannya.</p><p style=\"text-align: justify;\">Salah satunya dengan ritual Grebeg Gunung Slamet. Sebuah tradisi wisata dan budaya yang berbalut muatan spiritual.</p><p style=\"text-align: justify;\">Ketua Komunitas Radenpala, Irma Anggraeni mengatakan pendakian Grebeg Sura akan tetap digelar meski Gunung Slamet berstatus Waspada atau Level II. Namun, pendakian tak sampai puncak. Ritual pendakian akan dilakukan bertepatan dengan tibanya 1 Muharam, Sabtu petang, 31 Agustus 2019.</p><p style=\"text-align: justify;\">Sesuai dengan izin yang diberikan oleh Perhutani, pendakian untuk ritual Grebeg Sura hanya sampai Pos 1. Jarak antara Pos 1 dengan puncak masih empat kilometer, atau di luar zona berbahaya yang ditentukan oleh PVMBG.</p><p style=\"text-align: justify;\">\"Grebeg Sura akan tetap dilakukan. Karena itu memang sudah tradisi,\" ucapnya, Senin, 26 Agustus 2019.</p><p style=\"text-align: justify;\"><br></p><h4 style=\"text-align: justify;\">Ritual Pelestarian</h4><p style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"picsart-23-10-27-09-45-29-277-b3d9db551f181066f193895b5d81cb0d_600x400.jpg\" style=\"width: 50%;\"></p><p style=\"text-align: justify;\">Di Pos 1 atau Pos Kaliandra, peserta akan menggelar ritual zikir atau tahlil dan selamatan. Adapun pendakian ke puncak, sekaligus ritual sesaji ditiadakan.</p><p style=\"text-align: justify;\">Ritual pendakian diawali dengan laku bisu sejak pemberangkatan dari Pos Baturraden. Laku bisu adalah ritual mendaki tanpa bersuara. Sesampai di Pos 1, mereka akan menggelar dzikir, tahlil dan selamatan.</p><p style=\"text-align: justify;\">Menurut Irma, ditiadakannya pendakian ke puncak dalam rangkaian Grebeg Sura tidak mengurangi makna Grebeg Sura di Gunung Slamet. Sebab, tujuan ritual pendakian memang untuk mensyukuri nikmat yang diberikan Tuhan.</p><p style=\"text-align: justify;\">\"Memang untuk level waspada ini, kita mendaki di radius aman. Yang akan kita ambil kan memang, tujuannya mensyukuri nikmat Allah ya, dengan cara berdzikir. Di sana kan ada tahlilan juga, disertai dengan selamatan,\" dia menjelaskan.</p><p style=\"text-align: justify;\">Irma Anggraini menerangkan, Grebeg Sura adalah tradisi untuk mensyukuri berkah dari Tuhan. Di atas ketinggian Gunung Slamet, masyarakat berzikir untuk mengingat kebesaran Allah. Acara ini telah menjadi tradisi tahunan yang harus dilestarikan.</p><p style=\"text-align: justify;\">Menurut dia, tradisi itu akan menjadi bagian penting upaya pelestarian Gunung Slamet. Grebeg Sura digelar sejak tahun 2003, pada masa Juru Kunci Gunung Slamet, Mbah Syamsuri (Alm).</p><p style=\"text-align: justify;\">Rencananyanya ritual Grebeg Sura Gunung Slamet bakal diikuti oleh sekitar 60 orang. Rinciannya, 30 orang anggota Radenpala sebanyak 30 orang dan sisanya adalah masyarakat yang ingin turut mendaki pada malam 1 Sura.</p><p style=\"text-align: justify;\">Pada 2 Muharam atau Minggu, 1 September 2019, peserta juga akan menggelar dialog mengenai upaya konservasi Gunung Slamet. Selanjutnya, peserta akan menanam pohon di sekitar Pos Kaliandra.</p><p></p>', '2024-06-09 06:37:49', '2024-06-10 14:07:09');
INSERT INTO `berita` (`id`, `gambar`, `judul`, `isi`, `created_at`, `updated_at`) VALUES
(2, '3a9xJrmmR9pP3sBtWb6DLgFpB7WWOVVAeW52ozmb.jpg', 'Curug Jenggala, Destinasi Kemping Murah Meriah di Kaki Gunung Slamet', '<p style=\"text-align: justify; \">Akhir tahun menjadi momen pas untuk mengajak keluarga liburan dengan cara berbeda. Alih-alih staycation atau glamping, Anda bisa mengajak anak-anak dan pasangan menyatu dengan alam di camping ground. Meski lebih membutuhkan banyak persiapan, tidak ada salahnya untuk menghabiskan waktu liburan akhir tahun di alam terbuka.</p><p style=\"text-align: justify; \">Selain liburan ke kota besar sebut saja Bandung, Yogyakarta, Malang, Semarang, dan lainnya, kota Purwokerto bisa menjadi salah satu tujuan. Meski hanya ibu kota Kabupaten Banyumas, Purwokerto memiliki objek wisata Baturaden dengan segudang destinasi pilihan dengan nuansa yang sejuk.</p><p style=\"text-align: justify; \">Kecamatan yang berjarak 7,5 kilometer dari pusat kota Purwokerto ini memiliki sejumlah destinasi wisata alam terbuka yang memanjakan mata. Salah satunya, Curug Jenggala yang terletak di di Jalan Limboro, Dusun III Kalipagu, Ketenger, Kecamatan Baturraden, Kabupaten Banyumas, Jawa Tengah. Air terjun ini memiliki keunikan tersendiri karena berupa curug tumpuan tempat pertemuan dua sungai yakni Sungai Banjaran dan Sungai Mertelu dari kaki Gunung Slamet.<br></p><h4>Camping Murah Meriah</h4><p style=\"text-align: center; \"><img src=\"data:image/jpeg;base64,\" data-filename=\"eb5c74ce-b0c9-4d7d-808c-41015a3c745e.jpg\" style=\"width: 50%;\"><br></p><p style=\"text-align: justify; \">Selain lokasi yang strategis dan tarif pengunjung yang murah meriah, Curug Jenggala juga menyediakan fasilitas yang cukup lengkap. Mulai dari Mushola, toilet pria dan wanita, dan camping ground berumput. Jangan lupa untuk memilih lokasi camp di bawah pepohonan agar bisa menaungi dari panasnya matahari di pagi dan siang hari. Pada sore hingga malam hari, udara di kaki gunung Slamet ini memang cenderung sejuk dan dingin di kisaran 22 derajat celcius.</p><p style=\"text-align: justify; \">Selain fasilitas, di sekitar camping ground juga banyak warung makan yang menyediakan minuman kemasan, mi instan, makanan gorengan seperti mendoan, buah kelapa dan lain sebagainya. Keberadaan warung-warung ini sangat menguntungkan pengunjung maupun camper yang kehabisan bahan logistik selama camping atau berkunjung menuju lokasi curug.</p><p style=\"text-align: justify; \">Meski demikian, area camping ground masih belum ada akses listrik. Sehingga para camper maupun pengunjung tidak bisa mengisi daya baterai gawai maupun perangkat lainnya. Namun hal ini terbayar dengan kondisi malam hari. Jika cuaca cerah, camper bisa menikmati pemandangan langit malam dengan suasana hutan yang hening dan menikmati kemerlap kota Purwokerto dari atas.</p><p style=\"text-align: justify; \">Adapun waktu terbaik untuk bisa menikmati curug adalah di pagi hari selepas sunrise. Selain masih sepi, udara juga masih sejuk dan matahari belum terlalu meninggi. Sehingga jalan menuju curug relatif sejuk. Plus, pada pagi hari pengunjung juga belum terlalu ramai sehingga bisa menikmati keindahan curug dan berfoto dengan leluasa.</p><p style=\"text-align: justify; \">Nah, selain tarif masuk yang murah, Anda juga bisa menyewa berbagai perlengkapan camping di lokasi sebelum hari H menginap. Opsi lainnya, Anda juga bisa menyewa perlengkapan camping dari lokasi lain. Tarifnya juga cukup bersahabat, mulai dari tenda untuk kapasitas 4 orang yang seharga Rp 40.000-Rp 50.000 sehari, matras Rp 5.000 per buah sehari, cooking set/nesting Rp 10.000 per hari, kompor portable Rp15.000-Rp 25.000 per hari, lampu tenda Rp 5.000 per hari, dan lain-lain.</p><p style=\"text-align: justify;\">Karena itu, camping bisa menjadi salah satu cara menghabiskan liburan akhir tahun tanpa boncos. Selamat mencoba. Jangan lupa untuk membersihkan sampah Anda di area camping ground dan curug ya.</p>', '2024-06-10 13:04:10', '2024-06-10 13:14:56');
INSERT INTO `berita` (`id`, `gambar`, `judul`, `isi`, `created_at`, `updated_at`) VALUES
(3, 'B60n8CTNAJEAS7e8f5L4bnnEYtvAs0unKP0duGxG.jpg', '6 Fakta Menarik Gunung Slamet Gunung Tertinggi di Jawa Tengah', '<p style=\"text-align: justify;\">Gunung Slamet merupakan sebuah gunung berapi kerucut tipe A yang berlokasi di Jawa Tengah dan merupakan gunung tunggal yang terpisah dari pegunungan. Gunung Slamet mempunyai ketinggian 3.432 mdpl.</p><p style=\"text-align: justify;\">Gunung Slamet terletak di antara 5 kabupaten, yakni Kabupaten Banyumas, Kabupaten Purbalingga, Kabupaten Pemalang, Kabupaten Tegal dan Kabupaten Brebes. Gunung Slamet merupakan gunung dengan suhu rata-rata paling dingin di pulau Jawa serta salah satu daerah dengan curah hujan tahunan paling tinggi di Indonesia yaitu 8.134,00 milimeter (mm) per tahun.</p><p style=\"text-align: justify;\">Mengutip dari laman Gunung Bagging, Rabu, 4 Oktober 2023 Slamet adalah salah satu gunung berapi paling aktif di Jawa dan hampir selalu terdapat banyak gas di sekitar kawahnya. Gunung Slamet yang sangat besar dan puncak ladang lava yang luas merupakan salah satu tempat terbaik untuk melihat pantai utara dan selatan Jawa.&nbsp;</p><p style=\"text-align: justify;\">Francis Drake, seorang penjelajah asal Inggris mengarahkan perahunya untuk berlabuh di Cilacap di pantai selatan Jawa ketika mengunjungi Gunung Slamet. Masih banyak hal mengenai Gunung Slamet selain lokasi dan ketinggiannya. Berikut enam fakta menarik Gunung Slamet :</p><h5 style=\"text-align: justify;\">1. Gunung Tertinggi di Jawa Tengah</h5><p style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"250px-Gn_Slamet_dari_ketinggian_28_ribu_kaki.jpg\" style=\"width: 528px;\"><br></p><p style=\"text-align: justify;\">Gunung Slamet merupakan gunung tertinggi di Jawa Tengah dan gunung tertinggi kedua di pulau Jawa, setelah Gunung Semeru. Gunung Slamet pun adalah salah satu \"gunung tunggal\" terbesar atau terluas di Indonesia seperti halnya Gunung Tambora di Nusa Tenggara Barat, sebab memiliki diameter tunggal gunung.&nbsp;</p><h5 style=\"text-align: justify;\">2. Gunung Populer Bagi Pendaki</h5><p style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"kk224505_clip10.jpg\" style=\"width: 528px;\"></p><p style=\"text-align: justify;\">Gunung Slamet cukup populer sebagai tujuan pendakian lantaran statusnya sebagai gunung tertinggi di Jawa Tengah, meskipun medannya dikenal sulit dan memiliki suhu yang begitu dingin serta basah. Kawah IV adalah kawah terakhir yang masih aktif sampai sekarang, dan terakhir aktif hingga pada level siaga medio-2009.</p><h5 style=\"text-align: justify;\">3. Wisata Batu Raden dan Pemandian Air Panas di Kaki Gunungnya</h5><p style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"808870688.jpg\" style=\"width: 528px;\"></p><p style=\"text-align: justify;\">Saat ini, Gunung Slamet menjadi simbol serta kebanggaan bagi masyarakat di Tatar Banyumasan yang mendiami bagian barat Jawa Tengah atau dikenal wilayah Banyumas Raya. Di kaki gunung ini terletak kawasan wisata Baturraden yang menjadi tujuan wisata di Kabupaten Banyumas, dengan jarak sekitar 15 km dari Kota Purwokerto.</p><p style=\"text-align: justify;\">Selain itu terdapat wisata alam berupa pemandian air panas Guci yang berada di sisi utara Gunung Slamet, tepatnya di Kabupaten Tegal. Biasanya wisatawan yang tidak mendaki hanya berkunjung ke kaki Gunung Slamet untuk berendam di air panas yang tak jarang sangat ramai pada waktu libur tanggal merah maupun hari raya.</p><h5 style=\"text-align: justify;\">4. Legenda Nama Slamet Bagi Masyarakat Jawa</h5><div style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"DxgAxQVKjY.jpg\" style=\"width: 528px;\"></div><div style=\"text-align: justify;\"><div>Gunung Slamet punya cerita legenda yang turun-temurun. Nama slamet diambil dari bahasa Jawa yang artinya selamat memiliki makna doa untuk masyarakat setempat.</div><div><br></div><div>Penggunaan nama ini diberikan agar gunung ini tidak pernah meletus besar serta memberi rasa aman bagi warga sekitar. Menurut kepercayaan warga sekitar di dekat gunung, bila Gunung Slamet sampai meletus besar maka Pulau Jawa akan terbelah menjadi dua bagian. Meski begitu Gunung Slamet pernah beberapa kali aktif dan membuat fenomena menarik.</div><div><br></div><h5>5. Pendakian Cukup Panjang dan Sulit</h5><p style=\"text-align: center;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"620c9ba28b618.jpg\" style=\"width: 528px;\"></p><p>Ada banyak sekali rute pendakian dan semuanya panjang dan sulit untuk memperkirakan dengan tepat berapa lama waktu yang dibutuhkan untuk setiap rute karena akan sangat bervariasi dari orang ke orang. Cukuplah untuk mengatakan bahwa pendaki setidaknya memerlukan satu malam di gunung kecuali mendaki pada malam hari yang biasanya tidak disarankan.</p><p>Perhatikan bahwa jalur dapat ditutup dalam waktu singkat karena pekerjaan perbaikan, aktivitas gunung berapi, cuaca buruk, kebakaran hutan, atau seseorang baru saja hilang atau terluka. Pendakian Gunung Slamet dikenal cukup sulit karena hampir di sepanjang rute pendakian tidak ditemukan air.&nbsp;</p><p>Pendaki disarankan untuk membawa persediaan air yang cukup dari bawah. Faktor lain yang membuat gunung ini sulit ditaklukan adalah kabut. Kabut di Gunung Slamet sangat mudah berubah-ubah dan pekat.</p><h5>6. Jalur Pendakian Gunung Slamet</h5><p style=\"text-align: center; \"><img src=\"data:image/jpeg;base64,\" data-filename=\"images.jfif\" style=\"width: 50%;\"><br></p><p style=\"text-align: center;\"></p><p>Sementara itu, jalur pendakian tradisional Gunung Slamet adalah dari Bambangan, Desa Kutabawa, Kecamatan Karangreja, Purbalingga. Jalur populer lain menuju puncak Gunung Slamet yang relatif lebih baru dibuka dari arah selatan lewat Kabupaten Banyumas dan arah utara serta timur laut adalah dari Baturraden dan dari Desa Gambuhan, Desa Jurangmangu dan Desa Gunungsari di Kabupaten Pemalang.</p><p>Selain itu ada pula jalur yang baru saja diresmikan tahun 2013 lalu, yaitu jalur Dhipajaya yang terletak di Desa Clekatakan. Jalur pendakian lainnya adalah melalui objek wisata pemandian air panas Guci, Kabupaten Tegal. Meskipun terjal, rute ini menyajikan pemandangan yang paling baik.</p><p>Kawasan Guci dapat ditempuh dari Slawi menuju daerah Tuwel melewati Lebaksiu, sementara untuk jalur pendakian yang populer saat ini adalah jalur Permadi Guci dimana terdapat fasilitas Mushola Jabalussalam yang masuk dalam daftar Mushola tertinggi ke tiga di Indonesia, tersedianya air bersih yang melimpah disepanjang tahun serta tersedianya toilet umum yang berada di pos 4 amreta jalur pendakian tersebut.</p></div>', '2024-06-10 13:59:53', '2024-06-10 14:01:11');
INSERT INTO `berita` (`id`, `gambar`, `judul`, `isi`, `created_at`, `updated_at`) VALUES
(5, 'ZNXfdUj2KhfP1CLdKDPNJs1ghG9spEIKoJpavRfe.jpg', 'Mengenal Basecamp Dipajaya yang berada di Kabupaten Pemalang', '<p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Segoe UI, sans-serif\">Gunung Slamet berada di lima kabupaten, yaitu Kab. Banyumas, Brebes, Tegal, Pemalang dan Kab. Purbalingga, Jawa Tengah. Merupakan gunung berapi aktif, meskipun tergolong gunung berapi yang sering beraktifitas, namun gunung ini tidak pernah sepi dari kunjungan para pendaki. Gunung Slamet ini menjadi gunung tertinggi di Jawa tengah. kali ini saya akan mengupas secara detail mengenai basecamp pendakian Gunung Slamet via Dipajaya yang terletak di kabupaten Pemalang ini.</font></p><p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Segoe UI, sans-serif\"><br></font></p><p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Segoe UI, sans-serif\">Pendakian Gunung Slamet melalui jalur Dipajaya di Desa Clekatakan, Kecamatan Pulosari, Kabupaten Pemalang cukup diminati. Pendaki bisa menikmati beragam keindahan alam selama sepanjang perjalanan. aktivitas para pendaki di jalur Dipajaya terus ada. Pendakian diperkirakan mulai ramai saat musim libur sekolah.&nbsp;</font></p><p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Segoe UI, sans-serif\">Di basecamp ini mempunyai fasilitas yang bisa anda gunakan untuk kebutuhan pra pendakian, berikut beberapa fasilitas tersebut :</font></p><h4 style=\"text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Segoe UI, sans-serif\">1. Parkiran yang luas</font></h4><p class=\"MsoNormal\" style=\"text-align: center; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp Image 2024-06-17 at 23.02.06.jpeg\" style=\"width: 50%;\"><font face=\"Segoe UI, sans-serif\"><br></font></p><p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Segoe UI, sans-serif\">Pada halaman basecamp dipajaya ini mempunyai parkiran yang cukup luas. parkiran ini mampu menampung kendaraan seperti 3 sampai 4 travel dan beberapa motor para pendaki yang akan ditinggal naik pendakian. disini ada penjaga yang mengawasi kendaraan pendaki selama 24 jam.</font></p><h4 style=\"text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Segoe UI, sans-serif\">2. Warung makan di basecamp</font></h4><p class=\"MsoNormal\" style=\"text-align: center; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><img src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp Image 2024-06-17 at 23.02.09 (1).jpeg\" style=\"width: 50%;\"><font face=\"Segoe UI, sans-serif\"><br></font></p><p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Segoe UI, sans-serif\">Warung makan di basecamp pendakian ini menawarkan pengalaman kuliner yang hangat dan bersahaja bagi para pendaki. Terletak di kaki gunung yang dikelilingi oleh pemandangan alam yang memukau, warung ini menyediakan berbagai hidangan lokal yang lezat dan bergizi, mulai dari nasi goreng, mie rebus, hingga sop hangat yang cocok dinikmati setelah lelah mendaki. Dengan suasana yang ramah dan pelayanan yang cepat, warung makan ini menjadi tempat favorit para pendaki untuk mengisi tenaga sebelum atau sesudah menaklukkan puncak. Selain itu, terdapat juga pilihan minuman panas seperti kopi dan teh yang menjadi teman sempurna untuk bersantai di udara pegunungan yang sejuk.</font></p><h4 style=\"text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Segoe UI, sans-serif\">&nbsp;3. Tempat Registrasi dan Merchandise</font></h4><p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Segoe UI, sans-serif\">Registrasi di basecamp pendakian kami dirancang untuk memudahkan pendaki dalam mempersiapkan petualangan mereka. Proses registrasi yang cepat dan efisien memastikan pendaki mendapatkan semua informasi dan izin yang diperlukan untuk mendaki dengan aman. Selain itu, kami juga menawarkan penjualan merchandise eksklusif, termasuk kaos, topi, jaket, dan souvenir unik yang berhubungan dengan pendakian. Merchandise kami tidak hanya sebagai kenang-kenangan dari petualangan Anda, tetapi juga dibuat dengan bahan berkualitas tinggi yang tahan lama. Dengan berbagai pilihan desain menarik, pendaki dapat membawa pulang lebih dari sekadar pengalaman mendaki, tetapi juga memorabilia yang dapat dikenang sepanjang masa.</font></p><h4 style=\"text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Segoe UI, sans-serif\">4. Kamar Mandi dan Mushola</font></h4><p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Segoe UI, sans-serif\">Basecamp pendakian kami dilengkapi dengan fasilitas kamar mandi dan mushola yang nyaman dan bersih untuk memenuhi kebutuhan para pendaki. Kamar mandi kami dilengkapi dengan air panas dan dingin, serta fasilitas sanitasi yang modern, memastikan pendaki dapat membersihkan diri setelah perjalanan yang melelahkan. Mushola yang kami sediakan adalah tempat yang tenang dan bersih, memungkinkan pendaki menjalankan ibadah dengan khusyuk sebelum atau setelah pendakian. Selain itu, kami juga menawarkan penjualan merchandise eksklusif, termasuk kaos, topi, jaket, dan souvenir unik yang berhubungan dengan pendakian. Merchandise ini tidak hanya sebagai kenang-kenangan dari petualangan Anda, tetapi juga dibuat dengan bahan berkualitas tinggi yang tahan lama, memberikan pendaki lebih dari sekadar pengalaman mendaki, tetapi juga memorabilia yang dapat dikenang sepanjang masa.</font></p><h4 style=\"text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Segoe UI, sans-serif\">5. Tempat Penyewaan Alat Pendakian</font></h4><p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Segoe UI, sans-serif\">Penyewaan alat di basecamp pendakian kami menyediakan berbagai perlengkapan penting untuk para pendaki, mulai dari tenda, matras, sleeping bag, hingga kompor portabel dan peralatan masak. Semua peralatan kami terjamin kualitasnya dan selalu diperiksa secara berkala untuk memastikan keamanan dan kenyamanan selama pendakian. Layanan penyewaan ini dirancang untuk membantu pendaki, baik pemula maupun berpengalaman, yang mungkin tidak memiliki atau tidak ingin membawa peralatan berat. Dengan harga yang terjangkau dan proses penyewaan yang mudah, kami bertujuan untuk membuat setiap perjalanan mendaki menjadi lebih mudah dan menyenangkan, memungkinkan pendaki untuk fokus pada petualangan mereka tanpa khawatir tentang perlengkapan.</font></p><p class=\"MsoNormal\" style=\"text-align: justify; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><br></p>', '2024-06-17 17:06:40', '2024-06-17 17:12:02');

